classifyInteger :: Dialect -> String -> Type
classifyInteger d s = case (readMaybe s :: Maybe Integer) of
                      -- assuming number literals are always positive
                      Just n | n < (2 ^ (31 :: Integer)) -> canonicalizeType d $ typeInt
                             | n < (2 ^ (63 :: Integer)) -> canonicalizeType d $ typeBigInt
                      _ -> typeNumeric
